import React from 'react';
import './App.css';
import Navbar from './components/layout/Navbar';

function App() {
  return (
    <>
      <div className="bg-overlay">
        <div className="navbar-bg"></div>
          <Navbar className="navBar" />
      </div>
    </>
  );
}

export default App;
